import React from "react";


import NavbarNav from '../NavbarNav'

import styles from "./Navbar.module.css";



const Navbar = () => {

    return (
        <nav className="navbar">
            <div className="container">
                <div className={ styles.navbarRow}>
                    < NavbarNav/>
                </div>
            </div>
        </nav>
    )
}

export default Navbar;
